import React from 'react';
import ChooseFactionButton from '../components/ChooseFactionButton';
import factions from '../data/factions.json';
import { Box } from '@mui/material'



function Home() {
  let i = -1;

  return (
    <Box sx={{
      display: 'flex',
      justifyContent: 'center',
      width: '80%',
      border: 1
    }}>
    {
      factions.map((faction) => {
        i++;
        return(<ChooseFactionButton name={faction.fullname} key={i}/>);
      })
    }
    </Box>
  );
}

export default Home
